  return <div style={{backgroundImage: `url(${picture})`,
  height: "665px",
  backgroundSize: "cover",
  backgroundRepeat: "no-repeat",
  
  }}>
      <Box display="flex" flexDirection="column" alignItems="center">
        <Typography sx={{fontFamily:"fantasy"}} variant="h1"> BOOKSTORE LIBRARY APP </Typography>
        <Typography sx={{fontFamily:"fantasy",marginTop:15}} variant="h4"> GET YOUR BOOK TODAY !!</Typography>

      </Box>
    </div>;
  
};

export default About;
